import React from 'react';
import Dropdown from 'react-bootstrap/Dropdown';
import employeeData from './employeeData';

function GroupDropdown(props) {

//    const dropDownItems = employeeData.map(employee => <Dropdown.Item href="#/action-1">{employee.name}</Dropdown.Item>)
    const dropDownToggle = employeeData.map(employeeGroup =>  <div><Dropdown.Toggle className="groupDropdownButton" id="dropdown-basic">{employeeGroup.group}</Dropdown.Toggle>
    <Dropdown.Menu className="groupDropdownButton">
                   <Dropdown.Item href="#/action-1">{employeeGroup.name}</Dropdown.Item>
                </Dropdown.Menu></div>)

    return(
        <div>
            <Dropdown >
            {dropDownToggle}
            </Dropdown>
        </div>
    );
}

export default GroupDropdown;
